import App from './components/App';
import HomePage from './components/HomePage';
import LandingPage from './components/LandingPage';
import BookClubs from './components/BookClubs';
import BookProfile from './components/BookProfile';
import Books from './components/Books';
import Bookshelf from './components/Bookshelf';
import ClubBooks from './components/ClubBooks';
import ClubProfile from './components/ClubProfile';
import ClubMembers from './components/ClubMembers';
import CreateBookClub from './components/CreateBookClub';
import ErrorPage from './components/ErrorPage';
import Login from './components/Login';
import MyBookClubs from './components/MyBookClubs';
import Search from './components/Search';
import Signup from './components/Signup';
import UserProfile from './components/UserProfile';


const routes = [
    {
        path: '/',
        Element: <App />,
        errorElement: <ErrorPage />,
        children: [
            {
                path: '/',
                Element: <LandingPage />
            },
            {
                path: '/home',
                Element: <HomePage />
            },
            {
                path: '/login',
                Element: <Login />
            },
            {
                path: '/signup',
                Element: <Signup />
            },
            {
                path: '/search',
                Element: <Search />
            },
            {
                path: '/books',
                Element: <Books />,
                children: [
                    {
                        path: '/books/:id',
                        Element: <BookProfile />
                    }
                ]

            },
            {
                path: '/bookclubs',
                Element: <BookClubs />,
                children: [
                    {
                        path: '/bookclubs/:id',
                        Element: <ClubProfile />,
                        children: [
                            {
                                path: '/bookclubs/:id/members',
                                Element: <ClubMembers />
                            },
                            {
                                path: '/bookclubs/:id/books',
                                Element: <ClubBooks />
                            }
                        ]
                    }
                ]
            },
            {
                path: '/createbookclub',
                Element: <CreateBookClub />
            },
            {
                path: '/userprofile/:id',
                Element: <UserProfile />,
                children: [
                    {
                        path: '/userprofile/:id/bookshelf',
                        Element: <Bookshelf />
                    },
                    {
                        path: '/userprofile/:id/mybookclubs',
                        Element: <MyBookClubs />
                    }
                ]
            }
        ]
    }
]

export default routes;
